def process_job(job_number, endpoint_url, status_url):
    try:
        # Record start time
        start_time = time.time()
        
        # Send initial request
        response = requests.post(endpoint_url, headers=headers, json=data)
        initial_response_time = time.time() - start_time
        
        if response.status_code != 200:
            return {
                "request_number": job_number,
                "initial_response_time": initial_response_time,
                "total_time": None,
                "generation_time": None,
                "status": f"Failed with status {response.status_code}",
                "has_output": False
            }
            
        # Get job ID
        job_data = response.json()
        job_id = job_data.get("id")
        
        if not job_id:
            return {
                "request_number": job_number,
                "initial_response_time": initial_response_time,
                "total_time": None,
                "generation_time": None,
                "status": "No job ID returned",
                "has_output": False
            }
            
        # Poll for job completion
        status_endpoint = f"{status_url}{job_id}"
        max_attempts = 60  # Maximum 300 seconds wait time
        attempt = 0
        poll_interval = 5 
        
        while attempt < max_attempts:
            status_response = requests.get(status_endpoint, headers=headers)
            status_data = status_response.json()
            status = status_data.get("status")
            
            if status == "COMPLETED":
                total_time = time.time() - start_time
                output = status_data.get("output")
                return {
                    "request_number": job_number,
                    "initial_response_time": initial_response_time,
                    "total_time": total_time,
                    "generation_time": total_time - initial_response_time,
                    "status": "success",
                    "has_output": bool(output)
                }
                
            elif status in ["FAILED", "CANCELLED"]:
                total_time = time.time() - start_time
                return {
                    "request_number": job_number,
                    "initial_response_time": initial_response_time,
                    "total_time": total_time,
                    "generation_time": None,
                    "status": status,
                    "has_output": False
                }
                
            time.sleep(poll_interval)
            attempt += 1
            
        return {
            "request_number": job_number,
            "initial_response_time": initial_response_time,
            "total_time": None,
            "generation_time": None,
            "status": "Timed out",
            "has_output": False
        }
        
    except Exception as e:
        return {
            "request_number": job_number,
            "initial_response_time": None,
            "total_time": None,
            "generation_time": None,
            "status": f"Error: {str(e)}",
            "has_output": False
        }

def test_endpoint_performance(num_requests=20, max_concurrent=50):
    results = []
    endpoint_url = "https://api.runpod.ai/v2/tyicc95q00u35f/run"
    status_url = "https://api.runpod.ai/v2/tyicc95q00u35f/status/"
    
    print(f"Sending {num_requests} requests with max {max_concurrent} concurrent requests...")
    start_batch_time = time.time()
    
    # Use ThreadPoolExecutor with a fixed max_workers
    with ThreadPoolExecutor(max_workers=max_concurrent) as executor:
        # Submit all jobs
        future_to_job = {}
        for i in range(num_requests):
            print(f"Submitting request {i + 1}")
            future_to_job[executor.submit(process_job, i + 1, endpoint_url, status_url)] = i + 1
        
        # Process results as they complete
        for future in as_completed(future_to_job):
            result = future.result()
            results.append(result)
            
            if result["status"] == "success":
                print(f"Request {result['request_number']}: Initial: {result['initial_response_time']:.2f}s, "
                      f"Total: {result['total_time']:.2f}s, "
                      f"Generated: {result['generation_time']:.2f}s")
            else:
                print(f"Request {result['request_number']}: {result['status']}")
    
    # Calculate and print statistics
    total_batch_time = time.time() - start_batch_time
    successful = [r for r in results if r["status"] == "success"]
    
    if successful:
        avg_initial = sum(r["initial_response_time"] for r in successful) / len(successful)
        avg_total = sum(r["total_time"] for r in successful) / len(successful)
        avg_gen = sum(r["generation_time"] for r in successful) / len(successful)
        
        print("\nPerformance Statistics:")
        print(f"Total batch time: {total_batch_time:.2f}s")
        print(f"Successful requests: {len(successful)}/{num_requests}")
        print(f"Average initial response time: {avg_initial:.2f}s")
        print(f"Average total time: {avg_total:.2f}s")
        print(f"Average generation time: {avg_gen:.2f}s")

if __name__ == "__main__":
    # Replace the EXAMPLE_DEPTH_BASE64 with your actual base64 string in VSCode
    test_endpoint_performance(num_requests=50, max_concurrent=50)